import React, { Component } from "react";
import BroodjeMenu from "./BroodjeMenu";

class Broodje extends Component {
  render() {
    return (
      <div className="container">
        <h3>Broodje </h3>
        <BroodjeMenu key="1" />
        <BroodjeMenu key="2" />
        <BroodjeMenu key="3" />
      </div>
    );
  }
}

export default Broodje;
